INSERT INTO `messages` (`id`, `title`, `date`, `description`, `created_at`, `updated_at`, `deleted_at`) VALUES
(1, 'Welcome to the world of Glen', '2014-03-20', 'Congratulation! You have successfully installed The Glen Catalogue App on your Tablet. Complete the registration process by completing the profile. The App will update itself whenever in the Wi Fi  and you will always have an up to date information on your Tab. Use the App to showcase your products/pictures of Glen Galleries/Demo Videos to customers, send orders/complaints/suggestions to Head Office.', '0000-00-00 00:00:00', '0000-00-00 00:00:00', NULL),
(2, 'Introducing Chimney GL 6077', '2014-03-20', 'We are happy to announce that very soon we will be introducing a new chimney with Glass. It will have suction of 1000 M3 per hour and Baffle Filters with Life Time Warranty. The Glass will be available in three different colours Red/Black/Yellow. The MRP will be Rs. 17990 for 60 CM and 20,990 for 90 CM.', '0000-00-00 00:00:00', '0000-00-00 00:00:00', NULL),
(3, 'Mixer Grinder GL 4022 now with Glass Jar', '2014-03-20', 'You will be happy to know that we will be introducing a new model of GL 4022 with Glass Liquidizer Jar. It will be 750W motor and the MRP will be 4990/-. The advantages of Glass Jar are its more hygienic, its remains transparent for longer period, the taste of the food doesnt change after blending, looks good. The product will be available soon.', '0000-00-00 00:00:00', '0000-00-00 00:00:00', NULL),
(4, 'A new Model of Glass Grill', '2014-03-20', 'Dear All we are happy to inform you that a new model of Glass Grill GL 3035 with MRP 9990/- has been introduced and is now available. The grilling area is smaller than the GL 3033, the wattage is lower at 800W. The benefit of grilling on glass remains the same. This will help you to convert those customers who were finding the price of GL 3033 quite high.', '0000-00-00 00:00:00', '0000-00-00 00:00:00', NULL);
