(1, 'GL 462', '<h4>Features</h4>\r\n<ul>\r\n<li>Elegant SS exterior with glass lid</li>\r\n<li>Cast iron pan supports</li>\r\n<li>Italian thermostat and burners</li>\r\n<li>Auto ignition in all burners & oven/grill</li>\r\n<li>Large single chamber Gas oven/grill</li>\r\n<li>Flame failure device in oven </li>\r\n<li>Motorised rotisseries </li>\r\n<li>Minute minder - 120 minutes</li>\r\n<li>Light in oven</li>\r\n</ul>\r\n\r\n<h4>Cooking output</h4>\r\n<ul>\r\n  <li> Four burners- 1 Triple ring burner, 2 semi\r\nrapid burners & 1 auxiliary burner </li>\r\n</ul>', 9, 'GL 462', -1.00, 0.00, 2, 1, '2014-03-18 20:59:46', '2014-03-21 09:25:52', NULL),
(2, 'GL 492', '<h4>Features</h4>\r\n<ul>\r\n<li>Elegant SS exterior with glass lid</li>\r\n<li>Cast iron pan supports</li>\r\n<li>Italian thermostat and burners</li>\r\n<li>Auto ignition in all burners & oven/grill</li>\r\n<li>Large single chamber Gas oven/grill</li>\r\n<li>Flame failure device in oven </li>\r\n<li>Motorised rotisseries </li>\r\n<li>Minute minder - 120 minutes</li>\r\n<li>Light in oven</li>\r\n</ul>\r\n\r\n<h4>Cooking output</h4>\r\n<ul>\r\n  <li> Five burners - 1 Triple ring burner, 2 semi rapid\r\nburners, 1 rapid burner & 1 auxiliary burner </li>\r\n</ul>', 10, 'GL 492', -1.00, 0.00, 2, 2, '2014-03-18 21:08:32', '2014-03-21 09:28:00', NULL),
(3, 'GL 2011 SSTR', '<h4>Features</h4>\r\n<ul>\r\n<li>Spill Tray SS</li>\r\n    <li>Top lid - Toughened glass</li>\r\n    <li>Front - Black Glass</li>\r\n    <li>Italian thermostat for single</li>\r\n    <li>knob operation</li>\r\n    <li>Gas grill, gas oven</li>\r\n    <li>Motorised Rotisserie (optional)</li>\r\n</ul>\r\n\r\n<h4>Cooking output</h4>\r\n<ul>\r\n  <li> 1 Triple ring </li>\r\n  <li> 3 Aluminium alloy burners </li>\r\n</ul>\r\n\r\n<table style=\\''width:100%\\''>\r\n<tbody>\r\n<tr>\r\n<td colspan=\\''2\\''>Variant(s)</td>\r\n    </tr>\r\n    <tr>\r\n        <td class=\\''left-align\\''>GL 2011 SSTR\r\n</td>\r\n        <td class=\\''right-align\\''> 27990\r\n</td>\r\n    </tr>\r\n    </tbody>\r\n</table>              ', 4, 'GL 2011 SSTR', 26990.00, 0.00, 3, 1, '2014-03-18 21:20:41', '2014-03-21 09:40:58', NULL),
(5, 'GL 2012 PLTR', '<h4>Features</h4>\r\n<ul><li>Top lid - Toughened glass</li>\r\n<li>Gas grill, gas oven </li>\r\n<li>Italian\r\nthermostat for single knob oven\r\noperation (GL 2012PLTR) </li>\r\n<li>Gas grill, electric oven\r\n(GL 2023/24PLTR AI)</li>\r\n<li>Oven light, timer with hold\r\nfacility (GL 2023/24PLTR AI)</li>\r\n<li>Auto Ignition - top burners\r\n(AI model)</li>\r\n<li> Motorised Rotisserie (optional)</li>\r\n</ul>                \r\n\r\n<h4>Cooking output</h4>\r\n<ul>\r\n  <li>Triple-ring burner </li>\r\n  <li> Alloy burners (GL 2012/23PLTR) </li>\r\n  <li> Alloy burners & 1 hot plate\r\n(GL 2024PLTR AI) </li>\r\n</ul>\r\n\r\n<table style=\\''width:100%\\''>\r\n<tbody>\r\n<tr>\r\n<td colspan=\\''2\\''>Variant(s)</td>\r\n    </tr>\r\n    <tr>\r\n        <td class=\\''left-align\\''>Cooking Range 2012 PL TR AI\r\n\r\n</td>\r\n        <td class=\\''right-align\\''> 29990\r\n\r\n</td>\r\n    </tr>\r\n    </tbody>\r\n</table>           ', 5, 'GL 2012 PLTR', 28990.00, 0.00, 3, 2, '2014-03-18 22:16:57', '2014-03-21 09:50:56', NULL),
(6, 'GL 3056 DX', '<h4>Features</h4>\r\n<ul>\r\n    <li>Automatic rice cooking</li>\r\n    <li>Automatic keep warm\r\n        function keeps rice fresh for long\r\n    </li>\r\n    <li>Metallic silver\r\n        finish body\r\n    </li>\r\n    <li>Toughened glass lid , One touch\r\n        button for easy control\r\n    </li>\r\n    <li>Detachable power\r\n        cordfor convenient storage\r\n    </li>\r\n    <li>Easy-to-clean nonstick\r\n        pot with beehive pattern for better heat\r\n        distribution\r\n    </li>\r\n    <li>Measuring cup and spoon</li>\r\n    <li>Capacity 1.8 litres</li>\r\n    <li>650W</li>\r\n</ul>', 38, 'GL 3056 DX', 3290.00, 0.00, 21, 1, '2014-03-19 09:52:07', '2014-03-21 08:15:03', NULL),
(7, 'GL 3041', '<ul>\r\n    <li>Fry, grill, roast & even bake conveniently using little or no oil</li>\r\n    <li>Large cooking capacity (up to 800g)</li>\r\n    <li>Adjustable time & temperature control for perfect results (60 min timer, 6 temp settings) </li>\r\n    <li>Food separator to fry different dishes at the same time</li>\r\n    <li> Integrated air filter keeps the kitchen fresh</li>\r\n<li>LCD Display</li>\r\n<li>Easy to clean, removable basket</li>\r\n</ul>                ', 20, 'GL 3041', 16990.00, 0.00, 8, 1, '2014-03-19 10:16:22', '2014-03-22 02:56:39', NULL),
(8, 'GL 3034', '<ul>\r\n    <li>Fully automatic kneading and baking operation</li>\r\n    <li> 3.51/700-1000 g bread 12 settings for different kinds of bread</li>\r\n    <li>Choice of 3 crust setting</li>\r\n    <li>Audible tone signals time to add mix-ins such as nuts or fruit</li>\r\n    <li>Keeps bread warm for up to one hour</li>\r\n<li>Memory function up to 10 min in case of power failure</li>\r\n<li>Easy lift lid with a viewing window</li>\r\n<li> 615 W</li>\r\n</ul>', 21, 'GL 3034', 11990.00, 0.00, 9, 2, '2014-03-19 10:18:49', '2014-03-22 02:57:58', NULL),
(9, 'GL 4043 MC', '<ul>\r\n    <li>Small compact size - Capacity 400 ml</li>\r\n    <li>Food grade transparent PC bowl for clear visibility</li>\r\n    <li>Push start</li>\r\n    <li>Wisking disk</li>\r\n    <li>Rust-resistant stainless steel blades</li>\r\n<li>Non-slip ring for stability</li>\r\n<li>250 W</li>\r\n</ul>                                                           ', 22, 'GL 4043 MC', 1590.00, 0.00, 10, 3, '2014-03-19 10:21:23', '2014-03-22 02:59:37', NULL),
(10, 'GL 4043 MC Plus', '  <ul>\r\n    <li>Small compact size - Capacity 400 ml</li>\r\n    <li>Food grade transparent PC bowl for clear visibility</li>\r\n    <li> Push start</li>\r\n    <li>Wisking disk</li>\r\n    <li>Rust-resistant stainless steel blades</li>\r\n<li>Non-slip ring for stability</li>\r\n<li>250 W</li>\r\n<li>Additional bowl prevents flavour mixing especially when working with foods like onion, garlic, eggs etc.</li>\r\n</ul>                                           ', 44, 'GL 4043 MC Plus', 1790.00, 0.00, 10, 4, '2014-03-19 10:25:03', '2014-03-22 03:00:05', NULL),
(11, 'GL 6051 SS', '<p class=\\"desc\\">\r\n  A chimney with a single piece, joint-less matt steel body\r\n</p>\r\n<h4>Features</h4>\r\n<ul>\r\n    <li>Digital control with timer</li>\r\n    <li>Baffle filter</li>\r\n    <li>PDCA / FRP housing</li>\r\n    <li>2 energy saving 1.5 W LED lamps</li>\r\n    <li>Italian motor with TOP</li>\r\n</ul>\r\n\r\n<h4>Performance</h4>\r\n<ul>\r\n  <li>Airflow 1250 / 1000 m<sup>3</sup>/hr</li>\r\n</ul>\r\n\r\n<table style=\\''width:100%\\''>\r\n    <tbody>\r\n    <tr>\r\n        <td colspan=\\''2\\''>Variant(s)</td>\r\n    </tr>\r\n    <tr>\r\n        <td class=\\''left-align\\''>1000 m<sup>3</sup>/hr / 900 mm</td>\r\n        <td class=\\''right-align\\''> 20990</td>\r\n    </tr>\r\n    <tr>\r\n        <td class=\\''left-align\\''>1250 m<sup>3</sup>/hr / 600 mm</td>\r\n        <td class=\\''right-align\\''> 20990</td>\r\n    </tr>\r\n     <tr>\r\n        <td class=\\''left-align\\''>1250 m<sup>3</sup>/hr / 900 mm</td>\r\n        <td class=\\''right-align\\''> 23990</td>\r\n    </tr>\r\n    </tbody>\r\n</table>', 45, 'GL 6051 SS', 17990.00, 0.00, 27, 1, '2014-03-19 10:27:21', '2014-03-20 13:57:24', NULL),
(12, 'GL 4044', '<li>300 W</li>\r\n    <li>Single piece design</li>\r\n    <li>No more breaking couplers</li>\r\n    <li>Hygienic Stainless steel</li>\r\n    <li>Low noise design</li>\r\n<li>Less moving Part</li>\r\n<li>SS blade</li>\r\n<li>Hanging hook</li>\r\n<li>Plastic tumbler</li>\r\n</ul>                              ', 47, 'GL 4044', 1590.00, 0.00, 11, 5, '2014-03-19 10:29:43', '2014-03-22 03:01:20', NULL),
(13, 'GL 4045 B', '<ul>\r\n    <li>Super Quick Blender for instant shakes</li>\r\n    <li>Small compact size - Capacity 0.5 ltrs</li>\r\n    <li>Food grade transparent PC bowl for clear visibility</li>\r\n    <li>Push button switch</li>\r\n    <li>Rust-resistant stainless steel blade</li>\r\n    <li> 350 W</li>\r\n</ul>                ', 23, 'GL 4045 B', 1990.00, 0.00, 11, 6, '2014-03-19 10:32:16', '2014-03-22 03:02:55', NULL),
(14, 'GL 4045 BG', '<ul>\r\n    <li>Small compact size, Capacity 500 ml (Blender), 30 g (Grinder)</li>\r\n    <li>Food grade transparent bowl (Blender) & transparent lid (Grinder) for clear visibility</li>\r\n   <li>Push button switch</li>\r\n    <li>Rust-resistant stainless steel blade</li>\r\n    <li> 350 W</li>\r\n</ul>                 ', 51, 'GL 4045 BG', 2590.00, 0.00, 11, 7, '2014-03-19 10:35:56', '2014-03-22 03:03:46', NULL),
