(16, 'GL 4051', '<ul>\r\n <li>600 W heavy duty motor with 1 year warrant</li>\r\n    <li>Bowl</li>\r\n   <li>Bowl cover</li>\r\n    <li>2 Jars - Liquidiser, Grinder</li>\r\n    <li>Centrifugal juicer</li>\r\n    </li>Slicing cum shredding disc (reversible)</li>\r\n    </li>SS blade, Plastic blade</li>\r\n</li>Plastic blade</li>\r\n</li>3 speed settings with pulse function</li>\r\n</li>Overload protector mechanism</li>\r\n    <li> 5 years warranty on motor</li>\r\n   <li>Citrus juicer</li>\r\n    <li>Chipping disc</li>\r\n    <li> Whisking dsk</li>\r\n    </li>Chutney Jar</li>\r\n    </li>Coconut shredding disc</li>\r\n</ul>                             ', 54, 'GL 4051', 6990.00, 0.00, 12, 9, '2014-03-19 10:41:40', '2014-03-22 03:10:36', NULL),
